// export default Tasks
import Task from './Task';

const Tasks = ({data,onDelete,setData}) => {
  return (
    <>
    {data.map((data)=>(
        <Task key={data.id} task={data} onClick={onDelete} setTask={setData}/>
    ))}
    </>
  )
}

export default Tasks
